import React, {useLayoutEffect, useState} from 'react';
import {getAllClinics} from "../Clinics Components/Clinics Functions/ClinicsFunctions";
import WaitingQueueForm from "./WaitingQueueForm";
import {getEmployeesList} from "../Employee/Employee Logic/EmployeeFunctions";
import {getAllQueues} from "./Waiting Queue Logic/WaitingQueueFunctions";

const WaitingQueueMain = (props) => {

    const [clinics, setClinics] = useState([]);
    const [employees, setEmployees] = useState([]);
    const [loading, setLoading] = useState(false)
    const [totalPages, setTotalPages] = useState(1);
    const [waititngQueue,setWaititngQueue] = useState([])

    const fetchData = async () => {
        setLoading(false)
        setClinics(await getAllClinics());
        const res=await getEmployeesList();
        setEmployees(res.content);
        setTotalPages(res.totalPages);
        setWaititngQueue(await getAllQueues())
        setLoading(true)
        console.log("clinic",clinics)
    }

    useLayoutEffect(() => {
        fetchData()
    }, [])



    return (
        <div>
            {loading &&<WaitingQueueForm employees={employees} clinics={clinics} patient={props.location.state.patient}/>
            }
        </div>
    );
};

export default WaitingQueueMain;
